import React from 'react';
import styled from 'styled-components';

const BlogReadComponent: React.FC = () =>{
    const code:any = `<pre class="lang-javascript"><code data-language="javascript">console.log('test'); console.log('test'); console.log('test'); console.log('test'); console.log('test'); </code></pre>`;
    return(
        <Wrap>
            BlogReadComponent
        </Wrap>

    );
}

const Wrap = styled.div`
    height:100vh;
`;
export default BlogReadComponent;
